import React from "react";
import { Link } from "react-router-dom";
export const Comp=()=>
{
    const Close=async()=>
    {
        document.getElementById('sidebar').style.display="none";
    }
    const Open=async()=>
    {
        document.getElementById('sidebar').style.display="block";
    }
    return(
        <aside>
                <div className="drop">
                        <Link onClick={Open}>
                            <img src={"list.svg"} width={'35px'} alt="list"/>
                        </Link>
                </div>
                    <div className="dropbar"  style={{display:'none'}} id="sidebar">
                    <Link onClick={Close} className="drop">
                            <img src={"list.svg"} width={'35px'} alt="list"/>
                        </Link>
                            <Link to='/dashboard' className="asidebtn" ><b>Dashboard</b></Link>
                            <Link to='/usermanagement' className="asidebtn" ><b>User Management</b></Link>
                            <Link className="asidebtn" ><b>Admin User Management</b></Link>
                            <Link className="asidebtn" ><b>Project Management</b></Link>
                            <Link className="asidebtn" ><b>Unit Request Management</b></Link>
                    </div>
                </aside>
    )
}
